import React from 'react';
import Swiper from 'react-id-swiper';
import 'swiper/css/swiper.css';
import './cardSwiper.scss'
import CardGenerator from '../utils/CardGenerator';

class CardSwiper extends React.Component {

  constructor(props) {
    super(props);

    this.state = {
			data: this.props.data,
			sorted: [],
			column_titles: [],
			headers: [],
			params : {
				slidesPerView: 4,
				centeredSlides: true,
				spaceBetween: 30,
				grabCursor: true,
				pagination: {
					el: '.swiper-pagination',
					clickable: true
				}
			}
		}
	}

	render () {
		return (
			<Swiper {...this.state.params}> 
			{this.props.headers && this.props.data ? 
					// <CardGenerator data={this.state.data} />
					// <div id="one">Slide #1</div>
					// <div id="one">Slide 2</div>
					this.props.data.map((item, index) => 
						<div>
							{ item }
						</div>
						)
				: '' }

			</Swiper>
		)
	}
};


export default CardSwiper;
